import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={'https://i.pinimg.com/originals/15/66/6e/15666e8aeea9e89f8fddcd53239b6449.jpg'} className="App-logo" alt="logo" />
        <p>
          I hate myself
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
